(85, 'lead_manager', 'lead-manager-send-to-customer', 'english', 'Lead Manager (Sent Zoom Link)', 'Lead Manager Sent Zoom Link', '<html class=\"no-js\" lang=\"\"> <head> <link rel=\"preconnect\" href=\"https://fonts.googleapis.com\"><link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin><link href=\"https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&display=swap\" rel=\"stylesheet\"> </head> <body style=\" font-family: \"Noto Sans KR\", sans-serif;margin: 0; padding: 0; overflow-x: hidden; background-color: #f4f5f9; padding: 35px;\"> <section style=\"box-shadow: 0 4px 8px 0 rgb(241 241 241 / 20%), 0 6px 20px 0 rgb(212 212 212 / 19%); background-color: white; padding: 20px; max-width: 46%; margin: 0 auto; border: 1px solid #e4e4e4;\"> <div class=\" margin: 10px 6px; margin-bottom: 0;\"> <h4 style=\"margin: 0; font-size: 14px; text-transform: uppercase; font-weight: 500;\">Hi &nbsp;{customer_name},</h4> <p style=\" margin: 6px 0; font-size: 14px;\">Lead Manager Sent You a Meeting Url</p></div><table class=\"table\" style=\" width: 100%; margin-top: 30px;\"> <tbody> <tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010; position: relative; left: 2px; width: 25%;\">Topic :</th> <td style=\" border-top: 1px solid #dee2e6; font-size: 14px; padding-left: 15px;\">{topic}</td></tr><tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010;position: relative; left: 2px; width: 25%;\">Meeting ID :</th> <td style=\" border-top: 1px solid #dee2e6;font-size: 14px;padding-left: 15px;\">{meeting_id}</td></tr><tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010;position: relative; left: 2px; width: 25%;\">Time :</th> <td style=\" border-top: 1px solid #dee2e6; font-size: 14px;padding-left: 15px;\">{meeting_time}</td></tr><tr> <th style=\"padding:8px 0;vertical-align:top;border-top:1px solid #dee2e6;text-align:left;font-size:14px;color:#101010;width:25%\">Duration :</th> <td style=\"border-top:1px solid #dee2e6;font-size:14px;padding-left:15px\">{meeting_duration} Minutes</td></tr><tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010;position: relative; left: 2px; width: 25%;\">Password :</th> <td style=\" border-top: 1px solid #dee2e6; font-size: 14px;padding-left: 15px;\">{meeting_password}</td></tr></tbody> </table> <div > <a href=\"{join_url}\" target=\"_blank\"><button style=\"background-color: #2d8cff; border-color: transparent; padding: 11px 22px; color: white; border-radius: 7px; margin: 18px 0; font-weight: 500; font-size: 18px; cursor: pointer;\" type=\"button\" class=\"btn btn-secondary\">Start Meeting</button></a> </div><hr style=\" border: 1px solid #dedede;\"> <div style=\"text-align: right;padding: 0 0px;\"> <p style=\" margin: 2px;\">Thank You for choosing Lead Manager</p><b>- The Lead Manager Team</b> </div></section> </body></html>', '', NULL, 0, 1, 0),
(86, 'lead_manager', 'lead-manager-send-to-staff', 'english', 'Lead Manager (Sent Zoom Link)', 'Lead Manager Sent Zoom Link', '<html class=\"no-js\" lang=\"\"> <head> <link rel=\"preconnect\" href=\"https://fonts.googleapis.com\"><link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin><link href=\"https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&display=swap\" rel=\"stylesheet\"> </head> <body style=\" font-family: \"Noto Sans KR\", sans-serif;margin: 0; padding: 0; overflow-x: hidden; background-color: #f4f5f9; padding: 35px;\"> <section style=\"box-shadow: 0 4px 8px 0 rgb(241 241 241 / 20%), 0 6px 20px 0 rgb(212 212 212 / 19%); background-color: white; padding: 20px; max-width: 46%; margin: 0 auto; border: 1px solid #e4e4e4;\"> <div class=\" margin: 10px 6px; margin-bottom: 0;\"> <h4 style=\"margin: 0; font-size: 14px; text-transform: uppercase; font-weight: 500;\">Hi &nbsp;{staff_name},</h4> <p style=\" margin: 6px 0; font-size: 14px;\">Lead Manager Sent You a Meeting Url</p></div><table class=\"table\" style=\" width: 100%; margin-top: 30px;\"> <tbody> <tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010; position: relative; left: 2px; width: 25%;\">Topic :</th> <td style=\" border-top: 1px solid #dee2e6; font-size: 14px; padding-left: 15px;\">{topic}</td></tr><tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010;position: relative; left: 2px; width: 25%;\">Meeting ID :</th> <td style=\" border-top: 1px solid #dee2e6;font-size: 14px;padding-left: 15px;\">{meeting_id}</td></tr><tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010;position: relative; left: 2px; width: 25%;\">Time :</th> <td style=\" border-top: 1px solid #dee2e6; font-size: 14px;padding-left: 15px;\">{meeting_time}</td></tr><tr> <th style=\"padding:8px 0;vertical-align:top;border-top:1px solid #dee2e6;text-align:left;font-size:14px;color:#101010;width:25%\">Duration :</th> <td style=\"border-top:1px solid #dee2e6;font-size:14px;padding-left:15px\">{meeting_duration} Minutes</td></tr><tr> <th style=\" padding: 8px 0; vertical-align: top; border-top: 1px solid #dee2e6; text-align: left; font-size: 14px; color: #101010;position: relative; left: 2px; width: 25%;\">Password :</th> <td style=\" border-top: 1px solid #dee2e6; font-size: 14px;padding-left: 15px;\">{meeting_password}</td></tr></tbody> </table> <div > <a href=\"{join_url}\" target=\"_blank\"><button style=\"background-color: #2d8cff; border-color: transparent; padding: 11px 22px; color: white; border-radius: 7px; margin: 18px 0; font-weight: 500; font-size: 18px; cursor: pointer;\" type=\"button\" class=\"btn btn-secondary\">Start Meeting</button></a> </div><hr style=\" border: 1px solid #dedede;\"> <div style=\"text-align: right;padding: 0 0px;\"> <p style=\" margin: 2px;\">Thank You for choosing Lead Manager</p><b>- The Lead Manager Team</b> </div></section> </body></html>', '', NULL, 0, 1, 0),
