(18, 'Moroccan Companies Designs', '<ol>\n<li>Turkish rug co</li>\n<li>Turqoiuse mountain</li>\n<li>Momena Rug</li>\n<li>Kirkit rugs</li>\n<li>tamarian rugs</li>\n<li>samad rugs</li>\n<li>feizy rugs</li>\n<li>pisaurbanu</li>\n<li>loloirugs</li>\n<li>theart resources</li>\n<li>Bokhara rugs</li>\n<li>stark carpet</li>\n<li>crate and barrel</li>\n<li>marks</li>\n<li>far rugs</li>\n<li>marchphilips</li>\n<li>S&amp;H Rugs</li>\n<li>Palazzo Rugs</li>\n<li>Sofavi Rugs</li>\n<li>Restoration Hardware</li>\n<li>Alpine Rugs</li>\n<li>Momeni Rugs</li>\n<li>Samad Rugs</li>\n<li>Aryana Rugs</li>\n<li>Afghan Bazar</li>\n<li>Alpine Rugs</li>\n<li>Amer Rugs</li>\n<li>Andkhuy Rugs</li>\n<li>Anwar Rugs</li>\n<li>Art Resouces</li>\n<li>Azad USA</li>\n<li>Kalaty</li>\n<li>Kehkashan Rugs</li>\n<li>Liberty Rugs</li>\n<li>Lotfy and Sons</li>\n<li>Momeni</li>\n<li>Neman Internation</li>\n<li>Salim Trading Inc</li>\n<li>Shalom Brothers</li>\n<li>Tepp Team USA</li>\n<li>Turkish Carpet USA</li>\n<li>Turkish Rug Company</li>\n<li>Turkmen Rug</li>\n<li>Turquoise Mountain<br><br></li>\n</ol>', 2, '2023-09-12 17:39:08', '2023-09-12', NULL, NULL, 14, 0, 4, NULL, 0, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 1, 0, 0, 0.00, 0, 1, 0, 0, 0),
(19, 'Sintra.Ai', '<div class=\"mr-5 animate-fadeIn flex-col items-stretch gap-3 rounded-xl border px-5 py-4 font-sans text-base border-zi-primary-300 bg-zi-primary-100 text-zi-primary-900 flex\">\n<div class=\"relative flex items-center justify-between font-sans\">\n<p>Here are some <strong>content</strong> prompts to increase your <strong>social media presence</strong> and encourage <strong>engagement</strong> for EWC Interiors:</p>\n<ol>\n<li>\n<p>Caption This: Share a visually appealing image of an interior space, a rug, or a decor item, and ask your followers to come up with creative captions. This prompts them to engage with your content and showcases their creativity.</p>\n</li>\n<li>\n<p>Fill in the Blank: Post a sentence related to interior design or rugs and carpets, but leave a blank space for your followers to fill in. For example, \"The perfect rug can transform a ________ into a cozy sanctuary.\" Encourage them to comment with their answers.</p>\n</li>\n<li>\n<p>Guess the Style: Share a photo of a room or a specific decor item and ask your followers to guess the interior design style. This encourages interaction and showcases their knowledge of design trends.</p>\n</li>\n<li>\n<p>Polls and Surveys: Create polls or surveys related to interior design preferences, rug styles, or color choices. Ask your followers to vote or share their opinions. This not only increases engagement but also provides valuable insights.</p>\n</li>\n<li>\n<p>Design Dilemma: Encourage your followers to share their design dilemmas or decorating challenges. Ask them to describe a room or space they need help with and invite your community to offer suggestions, advice, or inspiration.</p>\n</li>\n<li>\n<p>Throwback Thursday: Share a photo of one of your earliest rug or interior design projects and ask your followers to guess the year it was created. This sparks nostalgia and invites your audience to engage with your brand history.</p>\n</li>\n<li>\n<p>Ask the Audience: Seek input from your followers on various interior design topics. For example, ask them to vote on their favorite color scheme for a specific room or which rug pattern they would choose for a particular style of decor.</p>\n</li>\n<li>\n<p>Testimonials and Success Stories: Encourage your customers to share their success stories or experiences with your products or services. Ask them to share how EWC Interiors has transformed their spaces and invite others to do the same.</p>\n</li>\n<li>\n<p>Interactive Quizzes: Create interactive quizzes related to interior design style, rug knowledge, or home decor trends. Invite your followers to participate and share their quiz results.</p>\n</li>\n<li>\n<p>User-Generated Content: Encourage your followers to share photos of their homes featuring EWC Interiors\' products. Create a branded hashtag and ask them to tag your brand. Share their photos on your page, giving credit, and showcasing their creativity.</p>\n</li>\n</ol>\n<p>Remember to consistently engage with your followers by responding to comments, liking their posts, and encouraging further conversation. Creating a sense of community and fostering relationships is key to building a strong social media presence.</p>\n</div>\n</div>', 2, '2023-09-20 18:03:18', '2023-09-20', NULL, '2023-09-20 18:03:43', 18, 0, 5, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 1, 0, 0, 0.00, 0, 1, 0, 0, 0),
(20, 'B2B System add on website', '<p><span style=\"font-weight:400;\">|--&gt; Step 1: Identify B2B Customers</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Marketing and Outreach</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Website Registration</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 2: Customer Registration</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Provide Company Information</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Verify Business Credentials</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 3: Browsing Products</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Browse Catalog</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Filter by Product Type, Size, Price, etc.</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 4: Selecting Products</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Add Products to Cart</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; View Cart</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 5: Request a Quote</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Review Cart</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Request a Quote</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 6: Quote Review</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Review Quote Details</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Accept or Modify Quote</span><span style=\"font-weight:400;\"><br><br></span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 7: Customer Support</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Address Customer Inquiries</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Handle Returns or Issues</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">|--&gt; Step 8: Feedback and Review</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Gather Customer Feedback</span></p>\n<p><span style=\"font-weight:400;\">|&#160; &#160; |--&gt; Encourage Reviews and Ratings</span></p>\n<p><span style=\"font-weight:400;\">|</span></p>\n<p><span style=\"font-weight:400;\">End</span></p>\n<p><br><br></p>', 2, '2023-09-21 12:21:41', '2023-09-21', NULL, NULL, 14, 0, 4, NULL, 0, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 0, 0, 0, 0.00, 0, 1, 0, 0, 0),
(21, 'All Marketing Tasks', '<p>These are the pointers which needs to be discussed:<br>Ahsan<br>1. Catalogue&#160;<br>2. Website (B2B , Dropbox)<br>3. Uns Socials , Branding&#160;<br>4. Etsy (Shopify , Domain A/C registration)<br>5. Linkedin (On going process)<br>https://pk.linkedin.com/in/ewcinteriors<br>6. Pinterest (On going process)<br>https://www.pinterest.com/ewcinteriors/<br>7. Youtube&#160;<br>https://www.youtube.com/@ewcinteriors<br>8. Research&#160;<br>9. Email Marketing&#160;<br>10. Seo (Review Pending)<br>11. Budget (Review)<br><br>Sana<br>1. Loyalty Program<br>2. Affiliate Marketing&#160;<br>3. Customer Reviews / Testimonials (Add to the website)<br>4. Branding to the store (like interwood etc)<br>5. Blogs (Add to the Website)<br>6. Seasonal Marketing Campaigns&#160;<br><br></p>', 2, '2023-09-25 13:56:17', '2023-09-25', '2023-12-31', '2023-09-26 12:49:02', 18, 0, 5, NULL, 0, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 1, 0, 0, 0.00, 0, 1, 0, 0, 0),
(22, 'Loyalty Program Road Map', '<p>Here is how loyalty program can work:<br><br>Ref Websites are:</p>\n<p><a href=\"https://incrediblerugsanddecor.com/pages/incredible-rugs-and-decor-loyalty-program\"><span style=\"font-weight:400;\">https://incrediblerugsanddecor.com/pages/incredible-rugs-and-decor-loyalty-program</span></a></p>\n<p><a href=\"https://www.magicrugs.com/rewards-program\"><span style=\"font-weight:400;\">https://www.magicrugs.com/rewards-program</span></a></p>\n<p><a href=\"https://www.revivalrugs.com/pages/revival-rewards\"><span style=\"font-weight:400;\">https://www.revivalrugs.com/pages/revival-rewards</span></a></p>', 2, '2023-09-25 14:07:47', '2023-09-25', NULL, NULL, 18, 0, 4, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 1, 0, 0, 0.00, 0, 1, 0, 0, 0),
(23, 'Talha ', '<p>14th Oct</p>\n<p><br>1. Keywords Research (Abbas , Afghan &amp; Kilim &amp; co)<br>2. On which pages they have more traffic<br>3. Google Spend Double &#8211; 80k per month<br>4. Selected story &#8211; Boost with link to the website<br>5. Budget would be allocated for both Traffic &amp; Engagement<br>6. Kilims &#8211; Traffic (40k per month allocated to it for sales conversations)</p>\n<p></p>\n<p>26th Sep 23</p>\n<p><br>Things to be discussed with Talha:</p>\n<p>1.Need to update sheet (weekly)</p>\n<p>2.Though we&#8217;re running ads but footfall &amp; instagram engagement is low since a week</p>\n<p>3.Since we won&#8217;t have sale , what is the best strategy to go with for sales!</p>\n<p>4.Need to run ads to designers, architect, and builders only as well for our b2b clientele</p>\n<p>5.Needs to send emails to the customers (we need to design creative)<br><br>6.Ads Manager Access to Wajahat</p>\n<p>7. Which kinds of ads we\'re adding?<br><br>- Let\'s try to push Moroccan to Dubai &amp; Saudia Arabia with a carousel ads (Top Shots)</p>', 2, '2023-09-26 13:02:23', '2023-09-26', NULL, NULL, 18, 0, 1, NULL, 0, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 1, 0, 0, 0.00, 0, 1, 0, 0, 0),
(24, 'Name Suggestion For Moroccan', '<p>Marakesh</p>\n<p>Nain</p>\n<p>Darija</p>\n<p>Viking Weave</p>\n<p>Pinstripe</p>\n<p>Nyssa</p>\n<p>Gul Mohar</p>\n<p>Nayel</p>\n<p>Scandavian Weaves</p>\n<p>Scandavian Pile</p>\n<p>Nordic Knits</p>\n<p>Nordic Wools</p>\n<p>Scandavian Living</p>\n<p>Pasham</p>\n<p>Zahara</p>\n<p>&#160;</p>\n<p>&#160;</p>', 2, '2023-09-28 13:09:52', '2023-09-28', NULL, NULL, 18, 0, 1, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 1, 0, 0, 0.00, 0, 1, 0, 0, 0),
